style.css:
@-moz-document url-prefix("https://w.amazon.com/bin/") {
body, .main, .document-header, #document-title, #document-title h1 {
    background: #222;
    color: #fff;
    font-family: 'Open Sans',Arial,sans-serif;
  }
  
  [style*="font-family:"] {
    font-family: 'Open Sans',Arial,sans-serif !important;
  }

  #footerglobal {
    background: #333;
    color: #fff;
  }
  
  .box {
    color: #000;
    filter: invert(100%) hue-rotate(180deg);
  }
    
  #headerglobalsearchinput {
    background: #304060;
    border: none;
    color: #fff;
  }
  
  a {
    color: #0af !important;
    text-decoration: none !important;
  }
  
  a:hover, a:focus {
    text-decoration: none !important;
  }
  
  .breadcrumb {
    background: #444;
  }
  
  a.btn {
    background: #333 linear-gradient(45deg,#333 50%,#444 50%);
    border: none;
  }
  
  .edit_section a {
    background: #222;
  }
  
  pre {
    background: #000;
    color: #fff;
  }
  
  img[src*="monitorportal.amazon.com"] {
    filter: invert(90%) hue-rotate(150deg) saturate(200%) brightness(150%);
    box-shadow: 0 0 30px #fafafa;
  }
  
  .MPWgraphInteractiveContainer {
    filter: invert(90%) hue-rotate(150deg) saturate(200%) brightness(150%);
    box-shadow: 0 0 30px #fafafa;
  }
  
  .xwikitabbar > li.active > a, .xwikitabbar > li.active > a:hover,
  .xwikitabbar > li.active > a:focus, #docextrapanes {
    background: #333;
    color: #fff;
    border: none;
  }
  
  .xwikitabbar > li > a:hover, .xwikitabbar > li > a:focus {
    background: #444;
    border: none;
  }
  
  .xwikitabbar {
    border-bottom: 1px solid #333;
  }
  
  .search-text-highlight {
    color: #000;
  }
  
  .search-facets {
    background: #333;
  }
  
  [style*="color:"]{
    color: #fff !important;
  }
  
  #xwikicontent > div[style*="background-color:#ffffff"] {
    background: #000 !important;
  }
  
  textarea, textarea[readonly], .commentcontent {
    background: #444;
    color: #fff;
  }
  
  table {
    background: #222 !important;
    color: #fff !important;
  }
  
  table td {
    background: #222 !important;
    color: #fff !important;
  }
}
